import React, { Component } from 'react';
import Particles from 'react-particles-js';
import Clarifai from 'clarifai';
import './App.css';
import Navigation from './Components/Navigation/Navigation';
import FaceRecognition from './Components/FaceRecognition/FaceRecognition';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkForm/ImageLinkForm';
import Rank from './Components/Rank/Rank';

const app = new Clarifai.App({
    apiKey: '3b2d6a108b6549f2baa43151f6f6bd22'
});

const particlesOptions = {
    particles: {
        number: {
            value: 150,
            density: {
                enable: true,
                value_area: 800
            }
        }
    }
}

class App extends Component {
  constructor() {
      super();
      this.state = {
          input: '', //interact parent with children
          imageUrl: ''
      }
  }

onInputChange = (event) => {
      this.setState({input: event.target.value}); // When event happens, get the event value
}

onButtonSubmit = () => {
      setState(({imageUrl: this.state.input}), callback);
        app.models
        .predict(
            Clarifai.FACE_DETECT_MODEL,
            this.state.input)
        .then(
        function(response) {
            console.log(response.output[0].data.regions[0].region_info.bounding_box);
            // do something with response
        },
        function(err) {
            // there was an error
        }
    );
}


  render() {
    return (
      <div className="App">
        <Particles className='particles'
        params={particlesOptions}
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm
            onInputChange={this.onInputChange}
            onButtonSubmit={this.onButtonSubmit}
        />
        <FaceRecognition
            imageUrl={this.state.imageUrl}
        />
      </div>
    );
  }
}

export default App;
